import emailpic from '../image/email-pic.png'

const ContactUs = () => {
    return ( 
        <div className = "contact-us">
            <h1>Contact Us</h1>

            <div className = 'contact-us-info'>
                <div  className = 'email'>
                    <img src = {emailpic} width = "50" alt = "logo" /> 
                    <p>fresherstrip.com.ng@gmail.com</p>
                </div>
            </div>
        </div>
    );
}
 
export default ContactUs;
